You probably know their clothing – but there’s a lot more to @Benetton than colors.

To celebrate our collaboration with the boundary-pushing brand, we’re spotlighting those who are speaking up and challenging conventions.

From Benetton in the ‘90s to our community in 2021 – we know there’s power in fashion to create social change.

Shop now in-app via the Explore page. Wear a piece of history, from a brand that stands for something.

